import React from 'react'

const NavBtn = ({img}) => {
  return (
    <div className='flex items-center'>
        <span className="text-White2 font-[500] text-[16px]">Benefits</span>
       { <img src="/icons/arrow-down.png" alt="" className="h-[14px] w-[14px]" />}
    </div>
  )
}

export default NavBtn;
